import React, {Component} from 'react';


class Child extends Component(props){

    constructor(props){
        super(props);
        this.state={
            hidden : "hidden"
        }
    }
        componentWillMount() {
            var that = this;
            setTimeout(function() {
                that.show();
            }, that.props.wait);
        }
   
        show() {
            this.setState({hidden : ""});
        }

    render(){
        return(
            <div>
                     <div className={this.state.hidden}>
                <p>1. Treat the smallest number i.e 135, as divisor (b) and bigger number i.e 225, as dividend 
                    (a)  {this.props.wait_one}ms</p>
                    <p>1. Treat the smallest number i.e 135, as divisor (b) and bigger number i.e 225, as dividend 
                    (a)  {this.props.wait_two}ms</p>
                    <p>1. Treat the smallest number i.e 135, as divisor (b) and bigger number i.e 225, as dividend 
                    (a)  {this.props.wait_three}ms</p>
            </div>

            </div>
        );
    }
}

export default Child;
